import React from 'react';
import { ThemeProvider } from 'styled-components';

import Home from './pages/Home';

import GlobalStyles from './styles/global';
import Themes from './styles/themes';

const App: React.FC = () => (
  <ThemeProvider theme={Themes}>
    <Home />
    <GlobalStyles />
  </ThemeProvider>
);

export default App;
